PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "yentu_history" (session text, version text, method text, arguments text, migration text, default_schema text, id integer PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "roles" (role_name text, role_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "departments" (department_name text NOT NULL, department_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "countries" (currency_symbol text, currency text, nationality text, country_code text, country_name text NOT NULL, country_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT country_name_uk UNIQUE (country_name));
CREATE TABLE "branches" (city_id integer, address text, branch_name text NOT NULL, branch_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "identification_types" (id_name text NOT NULL, id_type_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "banks" (swift_code text, bank_code text NOT NULL, bank_name text NOT NULL, bank_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT bank_name_uk UNIQUE (bank_name));
CREATE TABLE "relationships" (relationship_name text NOT NULL, relationship_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "notifications" (subject text, email text, sms text, tag text, notification_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "holidays" (holiday_date text NOT NULL, name text NOT NULL, holiday_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "configurations" (value text, key text, configuration_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT key_uk UNIQUE (key));
CREATE TABLE "cheque_formats" (data text NOT NULL, description text NOT NULL, cheque_format_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "binary_objects" (data blob, object_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "audit_trail_data" (data text, audit_trail_id integer NOT NULL, audit_trail_data_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "audit_trail" (data text, type real NOT NULL, audit_date text NOT NULL, description text NOT NULL, item_type text NOT NULL, item_id integer NOT NULL, user_id integer NOT NULL, audit_trail_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "locations" (address text, name text, location_id integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE "users" (branch_id integer, picture_id integer, department_id integer, phone text, email text NOT NULL, user_status real, other_names text, last_name text NOT NULL, first_name text NOT NULL, role_id integer, password text NOT NULL, user_name text NOT NULL, user_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT user_name_uk UNIQUE (user_name), CONSTRAINT users_branch_id_branches_branch_id_fk FOREIGN KEY (branch_id) REFERENCES branches (branch_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT users_department_id_departments_department_id_fk FOREIGN KEY (department_id) REFERENCES departments (department_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT users_role_id_fk FOREIGN KEY (role_id) REFERENCES roles (role_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "temporary_roles" (tag text, original_role_id integer, active integer, expires text, created text, user_id integer, new_role_id integer, temporary_role_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT temporary_rol_new_role_id_fk FOREIGN KEY (new_role_id) REFERENCES roles (role_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT temporary_rol_orig_role_id_fk FOREIGN KEY (original_role_id) REFERENCES roles (role_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT temporary_roles_user_id_fk FOREIGN KEY (user_id) REFERENCES users (user_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "suppliers" (user_id integer, telephone text, address text, supplier_name text NOT NULL, supplier_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT suppliers_user_id_fk FOREIGN KEY (user_id) REFERENCES users (user_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "permissions" (module text, value real NOT NULL, permission text, role_id integer NOT NULL, permission_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT permissios_role_id_fk FOREIGN KEY (role_id) REFERENCES roles (role_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "notes" (user_id integer NOT NULL, item_type text NOT NULL, item_id integer NOT NULL, note_time text NOT NULL, note text, note_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT notes_user_id_fk FOREIGN KEY (user_id) REFERENCES users (user_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "regions" (country_id integer NOT NULL, name text NOT NULL, region_code text NOT NULL, region_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT region_name_uk UNIQUE (name), CONSTRAINT regions_country_id_fk FOREIGN KEY (country_id) REFERENCES countries (country_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "note_attachments" (object_id integer, note_id integer, description text, note_attachment_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT note_attachments_note_id_fkey FOREIGN KEY (note_id) REFERENCES notes (note_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "clients" (branch_id integer NOT NULL, marital_status real, gender real, nationality_id integer, company_name text, contact_person text, in_trust_for text, country_id integer, id_issue_date text, id_issue_place text, signature text, scanned_id text, picture text, occupation text, residential_status real, id_number text NOT NULL, id_type_id integer NOT NULL, city_id integer, birth_date text, email text, fax text, mobile text, contact_tel text, residential_address text, mailing_address text NOT NULL, previous_names text, other_names text, first_name text, surname text, title text, account_type real NOT NULL, main_client_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT clients_branch_id_fkey FOREIGN KEY (branch_id) REFERENCES branches (branch_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT clients_city_id_fk FOREIGN KEY (city_id) REFERENCES cities (city_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT clients_country_id_fk FOREIGN KEY (country_id) REFERENCES countries (country_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT clients_id_type_id_fk FOREIGN KEY (id_type_id) REFERENCES identification_types (id_type_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT clients_nationality_id_fk FOREIGN KEY (nationality_id) REFERENCES countries (country_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "client_users" (status integer NOT NULL, user_name text NOT NULL, password text NOT NULL, membership_id integer, main_client_id integer, client_user_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT client_users_main_client_id_fk FOREIGN KEY (main_client_id) REFERENCES clients (main_client_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "client_joint_accounts" (mobile text, id_issue_date text, id_issue_place text, id_number text, id_type_id integer, office_telephone text, telephone text, address text, previous_names text, other_names text, first_name text NOT NULL, surname text NOT NULL, title text, main_client_id integer NOT NULL, joint_account_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT client_joint_id_type_id_fk FOREIGN KEY (id_type_id) REFERENCES identification_types (id_type_id) ON DELETE NO ACTION ON UPDATE NO ACTION, CONSTRAINT client_joint_main_client_id_fk FOREIGN KEY (main_client_id) REFERENCES clients (main_client_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "cities" (region_id integer NOT NULL, city_name text NOT NULL, city_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT city_name_uk UNIQUE (city_name), CONSTRAINT cities_region_id_fk FOREIGN KEY (region_id) REFERENCES regions (region_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "bank_branches" (sort_code text NOT NULL, address text, branch_name text NOT NULL, bank_id integer NOT NULL, bank_branch_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT branch_bank_id_fk FOREIGN KEY (bank_id) REFERENCES banks (bank_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
CREATE TABLE "api_keys" (secret text NOT NULL, key text NOT NULL, active integer NOT NULL, user_id integer NOT NULL, api_key_id integer NOT NULL PRIMARY KEY AUTOINCREMENT, CONSTRAINT api_keys_user_id_fkey FOREIGN KEY (user_id) REFERENCES users (user_id) ON DELETE NO ACTION ON UPDATE NO ACTION);
DELETE FROM sqlite_sequence;
CREATE INDEX audit_trail_id_idx ON audit_trail_data (audit_trail_id);
CREATE INDEX audit_trail_item_id_idx ON audit_trail (item_id);
CREATE VIEW users_view AS SELECT * FROM users JOIN roles USING (role_id);
CREATE VIEW countries_view AS SELECT * FROM countries JOIN regions USING (country_id);
COMMIT;
